import React, { useContext } from "react";
import { Link } from "react-router-dom";

import { AllContext } from "./context";

const Navbar = () => {
  const { user } = useContext(AllContext);

  return (
    <div>
      {user? (
        <nav class="navbar navbar-dark bg-dark">
        <Link to="/homepage">
          
          <button>Homepage </button>
        </Link>
        <h3 style={{ color: "white" }}> welcome back {user.name} </h3>
          <button className="btn btn-danger" id="html">
            <span id="htmltxt">Logout</span>
          </button>
      
      </nav>
      )
      :
      (
        <nav class="navbar navbar-dark bg-dark"> <Link to="/homepage"> <label>Homepage </label> </Link> <h3 style={{ color: "red" }}> welcome back {user.name} </h3> <Link to="/login"> <button className="btn btn-success" id="html"> <span id="htmltxt">Login</span> </button> </Link> <Link to="/signup"> <button className="btn btn-warning" id="html"> <span id="htmltxt">Signup</span> </button> </Link> </nav>
      )
}
    </div>
  );
};

export default Navbar;
